    useEffect(() => {
        fetch('/index')
            .then(res => res.json())
            .then(data => setCurrTime(data.time));
    }, []);

    // edit mode

    return (
        <div className="App">
            {/*<header className="App-header"></header>*/}
            <p>lol: {currTime}</p>
            <div className="bukh">
                <h1>Party</h1>
                <PartyTable/>
            </div>

        </div>
    );
}

export default App;
